 import './Login.css';
import React from 'react';
import ReactDOM from 'react-dom';
import Tittle from '../Components/Tittle';
// import BookRide from './BookRide/';//
import { Link } from "react-router-dom";
class LoginPage extends React.Component{
  render(){
    return(
<div className="LoginPage">
            <Tittle title={'Login'} span={'Login'} />
       <div className="container">
        <div className="form-box">
          <div className="header-form">
            <h4 className="text-primary text-center"><i className="fa fa-user-circle" style={{fontSize:"110px"}}></i></h4>
            <div className="image">
            </div>
          </div>
          <div className="body-form">
           <form>
              <div className="input-group mb-3">
   <div className="input-group-prepend">
    <span className="input-group-text"><i class="fa fa-user"></i></span>
  </div>
  <input type="text" className="form-control" placeholder="Username" />
</div>
 <div className="input-group mb-3">
   <div className="input-group-prepend">
    <span className="input-group-text"><i class="fa fa-lock"></i></span>
  </div>
  <input type="password" className="form-control" placeholder="Password" />
</div>
{/* <BrowserRouter> */}
  {/* <Link to="/bookride"> */}
      <button type="button" className="btn btn-secondary btn-block">LOGIN</button>
  {/* </Link>/ */}
  {/* <Route path="/bookride" exact component={BookRide} /> */}

{/* </BrowserRouter> */}
 <div className="message">
<div><input type="checkbox" /> Remember ME</div>
 <div><a href="/">Didn't register?</a></div>
 </div>
   </form>
            <div className="social">
              <a href="https://www.facebook.com/"><i className="fab fa-facebook"></i></a>
              <a href="https://twitter.com/login"><i className="fab fa-twitter-square"></i></a>
              <a href="#"><i className="fab fa-google"></i></a>
            </div>
          </div>
        </div>
       </div>   
       </div>
    )
  }
}

// ReactDOM.render(<LoginPage />, document.getElementById('root'));
export default LoginPage;
